import styled from "styled-components";

export const Buttons = styled.button`
    background-color: gray;
    padding: 10px;
    border-radius: 10px;
    box-shadow: 2px 2px 4px rgba(0,0,0,0.5);

    &:hover {
        background-color: blue;
    }
`
